CREATE DEFINER=`master431`@`%` PROCEDURE `activatePack`(IN sGame INT(5), IN sPack INT(6), IN sNbr INT(3), sEmp_id VARCHAR(6))
BEGIN

  set @sStore = '111111';
  set @sDate = DATE(curdate());
  set @sActivated = true;
  set @sLoadedPack = true;
  set @sPrice = (SELECT Price FROM tblTickets WHERE Game=@sGame and Price IS NOT NULL Group by Price);
  set @sStart_Inv = true;
  set @End_Inv = false;
  set @Emp = sEmp_id;
  set @EndPack = true;
  set @UpdateStart = false;
  set @sClosePack = false;
  
 /*
    This assumes that someone is trying to activate a pack twice.  Prevents data insertion issues.
*/ 
 IF EXISTS (Select * from tblTickets WHERE Game=sGame AND Pack=sPack AND Nbr=sNbr AND Date=@sDate) THEN
         UPDATE `SIS`.`tblTickets` SET `Activated` = true, `LoadedPack` = true,`Start_Inv` = true, `End_Inv` = false, Emp_id=sEmp_id, `Date` = DATE(curdate()) 
		 WHERE Game = sGame AND Pack=sPack AND Nbr=sNbr AND date=@sDate;
 ELSE
 /*
    If the ticket being scanned does not exist in the inventory 
    then the following lines will execute
    It will get the price of the game
    It will insert the just scanned ticket newly loaded into the bin.
    It will insert a line closing the previous pack.  
    This number was never scanned but calculated and inserted into the table.
*/
  -- A pack that is started and not closed will be closed when we activate a new pack
      
      set @sPackAmount = (SELECT 1 + Nbr FROM tblTickets where Game=sGame and Pack=sPack and Activated = false AND Start_Inv= false  AND End_Inv= false  group by Nbr);
      set @sName = (SELECT Name FROM tblTickets WHERE Game=sGame AND Name IS NOT NULL group by Name);
	  set @sStartNotClosedPack = (SELECT Pack FROM tblTickets where Game=sGame and Activated=true  and LoadedPack=true and Pack!=sPack group by Pack);
      
      set @sPrice = (SELECT Price FROM tblTickets WHERE Game=sGame AND Price IS NOT NULL group by Price);
	  
      -- Activates the pack and puts in the game pack 000 into the inventory with todays date -- 
      INSERT INTO `SIS`.`tblTickets`
          VALUES(sGame, sPack, sNbr, @sName, @sStore, @sDate, @sActivated, @sLoadedPack, @sPrice, @sStart_Inv, @End_Inv, sEmp_id);
	  

 
  IF @sStartNotClosedPack IS NOT NULL then  
    -- Not the correct logic
    -- Inserts into the inventory the the previos opened pack ending ticket +1  CLOSING THE PACK OUT--
    -- INSERT INTO `SIS`.`tblTickets` 
    -- VALUES(sGame, @sStartNotClosedPack, @sPackAmount, @sName, @sStore, @sDate, @sActivated, @sClosePack, @sPrice, @UpdateStart, @EndPack, sEmp);
    
    -- Upated the seeded inventory ticket numner with end of day as true instead
       UPDATE `SIS`.`tblTickets` SET End_Inv=true, date=@sDate, Emp_id=sEmp_id where Game=sGame AND Pack=@sStartNotClosedPack AND Activated=false;
    -- VALUES(sGame, @sStartNotClosedPack, @sPackAmount, @sName, @sStore, @sDate, @sActivated, @sClosePack, @sPrice, @UpdateStart, @EndPack, sEmp);
    -- update inventory for closed pack as not being loaded in the bins  --
       UPDATE `SIS`.`tblTickets` SET LoadedPack=false, Activated=true WHERE Game=sGame AND Pack=@sStartNotClosedPack;
     END IF;   
END IF;
END ;;
DELIMITER ;
