CREATE DEFINER=`master431`@`%` PROCEDURE `addUpdateUserByEmp_id`(
IN sEmp_id varchar(6),
IN sFirst varchar(20), 
IN sLast varchar(20),
IN sEmail varchar(50),
IN sIsAdmin TINYINT(1), 
IN sPassword VARCHAR(45) )
BEGIN
  set @sEmpExists := (select Emp_id from tblUsers where Emp_id=sEmp_id);
	IF @sEmpExists IS NOT NULL then
		UPDATE `SIS`.`tblUsers` SET First=sFirst, Last=sLast, Email=sEmail, IsAdmin=sIsAdmin, Password=sPassword where Emp_id=sEmp_id and sEmp_id is not null;

	else
		INSERT INTO `SIS`.`tblUsers` (`Emp_id`, `First`, `Last`, `Email`, `IsAdmin`, `Password`) VALUES (sEmp_id, sFirst, sLast, sEmail, sIsAdmin, sPassword);
	end if;
END ;;
