CREATE DEFINER=`master431`@`%` PROCEDURE `dailyCounts`()
BEGIN

DROP TEMPORARY TABLE IF EXISTS t1;
CREATE TEMPORARY TABLE t1 (Select Game, Pack, Nbr, LoadedPack, game as Total  FROM SIS.tblTickets WHERE Date = curdate() and Activated=true);

DROP TEMPORARY TABLE IF EXISTS t2;
CREATE TEMPORARY TABLE t2 (Select Pack, Game, MAX(Nbr) as End, MIN(Nbr) as Begin, Max(Nbr) - Min(Nbr) as Total, MAX(LoadedPack) as Loaded from t1 group by Game, Pack);

DROP TEMPORARY TABLE IF EXISTS t3;
CREATE TEMPORARY TABLE t3 (select if (Loaded=1, Total, sum(Total + 1)) as FinalTotal, Game, Pack from t2 group by Game, Pack );
-- Select * from t3;

Select SUM(FinalTotal), Game from t3 group by Game;
END ;;
