CREATE DEFINER=`master431`@`%` PROCEDURE `endDayEmp`(IN sGame INT(5), IN sPack INT(6), IN sNbr INT(3), IN sEmp varchar(6))
BEGIN
  set @sName = (SELECT Name FROM tblTickets WHERE Game=sGame AND Pack=sPack and Name IS NOT NULL group by Name);
  set @sStore = '111111';
  set @sDate = DATE(curdate());
  set @sActivated = true;
  set @sLoadedPack = true;
  set @sPrice = (SELECT Price FROM tblTickets WHERE Game=sGame AND Pack=sPack and Price IS NOT NULL Group by Price);
  set @End_Inv = true;
  set @Emp = sEmp;
  set @sStart_Inv = false;
  
 IF EXISTS (Select * from tblTickets WHERE Game=sGame AND Pack=sPack AND Nbr=sNbr AND Date=@sDate) THEN
         UPDATE `SIS`.`tblTickets` SET `Activated` = true, `LoadedPack` = true, `End_Inv` = true, Emp_id=@Emp , `Date` = DATE(curdate()) 
		 WHERE Game = sGame AND Pack=sPack AND Nbr=sNbr AND date=@sDate;
 ELSE
      set @sName := (Select Name FROM tblTickets WHERE Game=sGame AND Pack=sPack AND Name IS NOT NULL group by Name);
      set @sPrice := (Select Price FROM tblTickets WHERE Game=sGame AND Pack=sPack AND Price IS NOT NULL group by Price);
	  INSERT INTO `SIS`.`tblTickets` 
      VALUES(sGame, sPack, sNbr, @sName, @sStore, @sDate, @sActivated, @sLoadedPack, @sPrice, @sStart_Inv, @End_Inv, sEmp);
     
 END IF;
 END ;;
