CREATE DEFINER=`master431`@`%` PROCEDURE `seedExistingGame`(IN sGame INT(5), IN sPack INT(6), IN sNbr INT(3), sEmp_id VARCHAR(6))
BEGIN
  set @sName = (SELECT Name FROM tblTickets WHERE Game=sGame and Name IS NOT NULL group by Name);
  set @sStore = '111111';
  set @sDate = DATE(curdate());
  set @sActivated = false;
  set @sLoadedPack = false;
  set @sPrice = (SELECT Price FROM tblTickets WHERE Game=sGame and Price IS NOT NULL Group by Price);
  set @sStart_Inv = false;
  set @End_Inv = false;
  
   
 IF EXISTS (Select * from tblTickets WHERE Game=sGame and Pack=sPack) THEN
         UPDATE `SIS`.`tblTickets` SET `Activated` = false, `LoadedPack` = false ,`Start_Inv` = false, `End_Inv` = false, `Emp_id` = @sEmp_id, `Date` = DATE(curdate()), `Price` = sPrice, `Name` = sName
         WHERE Game = sGame;
 ELSE
      INSERT INTO `SIS`.`tblTickets` 
      VALUES(sGame, sPack, sNbr, @sName, @sStore, @sDate, @sActivated, @sLoadedPack, @sPrice, @sStart_Inv, @End_Inv, sEmp_id);
     
 END IF;
 
END ;;
